import React, { Component,useEffect } from 'react';
import './contact.css';
import Aos from 'aos';
import 'aos/dist/aos.css';
import Img from './contact.jpeg';

const Portfolio = () => {
    useEffect(() => {
        Aos.init({duration:1500});
    },[]);

    return (
        
    	<div id='contact'>
           <div className='parallax' 
            style={{backgroundImage:'url(' + Img + ')',height:'auto',maxWidth:'100%'}}>
            <div className='ovrlay'>
                 <h1 className='head'> CONTACT ME</h1>
            <div className='container'>
                <div data-aos='zoom-in' className='grid-item'>
                    <h5 style={{textAlign:'center',marginTop:20}}> Location </h5>
                </div>
                <div data-aos='zoom-in' className='grid-item'></div>
                <div data-aos='zoom-in' className='grid-item'></div>
                <div data-aos='zoom-in' className='grid-item'></div>       
            </div>
            </div>
            </div>
            
        </div>
    );
}

export default Portfolio;
